import classes from "./Input.module.css";
import { Fragment } from "react";

const Input = (props) => {
  return (
    <Fragment>
      <div className={classes.input}></div>
      <label htmlFor={props.input.id}>{props.label}</label>
      <input {...props.input}/>
    </Fragment>
  );
};

export default Input;
